import React from "react";

export default function Gallery({ rects, handleRemoveRect }) {
  return (
    <div>
      <h1>Galeria</h1>
      {Boolean(rects.length) && (
        <ul>
          {rects.map((rect, index) => {
            return (
              <div key={index}>
                <li>
                  <div
                    className="output-rect"
                    style={{
                      backgroundColor: rect.backgroundColor,
                      width: `${rect.width}px`,
                      height: `${rect.height}px`,
                      borderRadius: `${rect.borderRadius}px`,
                    }}
                  ></div>
                </li>
                <button onClick={handleRemoveRect(index)}>
                  Remove {index}
                </button>
              </div>
            );
          })}
        </ul>
      )}
    </div>
  );
}
